import React, { useState } from "react";
import Loading from "../LoadingError/Loading";
import Message from "../LoadingError/Error";
//import { Link } from "react-router-dom";
//import moment from "moment";

const Transactions = (props) => {
  const { loading, error } = props;

  const [name, setName] = useState("");
  const [address, setAddress] = useState("");
  const [city, setCity] = useState("");
  const [accountNumber, setAccountNumber] = useState();
  const [amount, setAmount] = useState();

  return (
    <div className=" d-flex justify-content-center align-items-center flex-column">
      {loading ? (
        <Loading />
      ) : error ? (
        <Message variant="alert-danger">{error}</Message>
      ) : (
        <>
          <div className="container mt-5">
            <div className="row">
              <div className="col-6 align-items-start mb-5 my-acc">
                <div className="col-6 align-items-start">
                  <div className="row">
                    <h3>Citizen current account</h3>
                    <p>account number: 258</p>
                  </div>
                  <div className="row justify-content-between">
                    <p>account balance:</p>
                    <h2>$1.589</h2>
                  </div>
                  <div className="row justify-content-between">
                    <p>account balance:</p>
                    <h2>$1.589</h2>
                  </div>
                </div>
                <div className="col-6 align-items-start">
                  <div className="row justify-content-between">
                    <h2>Name:</h2>
                    <h2>Admin</h2>
                  </div>
                  <div className="row justify-content-between">
                    <h2>Address:</h2>
                    <h2>PETI PRIGRADSKI PUT BB</h2>
                  </div>
                  <div className="row justify-content-between">
                    <h2>City:</h2>
                    <h2>BANJALUKA</h2>
                  </div>
                  <div className="row justify-content-between">
                    <h2>Purpose of payment:</h2>
                    <h2>paying the fine</h2>
                  </div>
                </div>
              </div>
              <div className="col-6 align-items-start mb-5 trans-to">
                <div className="col-6 align-items-start">
                  <div className="row">
                    <input
                      className="input-acc"
                      type="text"
                      value={accountNumber}
                      onChange={(e) => {
                        setAccountNumber(e.target.value);
                      }}
                    />
                  </div>
                </div>
                <div className="col-6 align-items-start">
                  <div className="row justify-content-between">
                    <label className="label-1">Name:</label>
                    <input
                      className="input-acc"
                      type="text"
                      value={name}
                      onChange={(e) => {
                        setName(e.target.value);
                      }}
                    />
                  </div>
                  <div className="row justify-content-between">
                    <label className="label-1">Address:</label>
                    <input
                      className="input-acc"
                      type="text"
                      value={address}
                      onChange={(e) => {
                        setAddress(e.target.value);
                      }}
                    />
                  </div>
                  <div className="row justify-content-between">
                    <label className="label-1">City:</label>
                    <input
                      className="input-acc"
                      type="text"
                      value={city}
                      onChange={(e) => {
                        setCity(e.target.value);
                      }}
                    />
                  </div>
                  <div className="row justify-content-between">
                    <label className="label-1">Amount:</label>
                    <input
                      className="input-acc"
                      type="number"
                      value={amount}
                      onChange={(e) => {
                        setAmount(e.target.value);
                      }}
                    />
                  </div>
                  <div className="row justify-content-between">
                    <label className="label-1">Account Number:</label>
                    <input
                      className="input-acc"
                      type="text"
                      value={name}
                      onChange={(e) => {
                        setName(e.target.value);
                      }}
                    />
                  </div>
                </div>
              </div>
            </div>
          </div>
        </>
      )}
    </div>
  );
};

export default Transactions;
